%[text] %[text:anchor:T_E1F9CD96] # **Scatter Density Chart Examples**
%[text] **Overview**
%[text] The `ScatterDensityChart` manages bivariate scattered data and colors the scatter plot markers based on their density. The chart data comprises numeric, real vectors `XData` and `YData`. The chart scatters the `YData` against the `XData`, with the scatter series' `CData` property (the color used for each plot marker) based on the density evaluated by the chart at each point.
%[text] The density calculation method is specified by the chart property `DensityMethod`, which is one of the following options.
%[text] - `"noboundary"` (the default method): a circle of radius $r$ is drawn around each data point and the density is calculated as the number of data points per unit area inside this circle, excluding the point itself. The radius $r$ is a user-settable parameter, corresponding to the chart property `Radius`. Setting this chart property will update the colors used in the scatter series.
%[text] - `"boundary"`: this method first creates a rectangle delimited by the bounds of the chart data, and then the above method is applied, with the difference that only the area surrounding each data point and fully contained within the rectangle is used. \
%[text] Both methods can be computationally expensive if the number of data points is very large.
%[text] ![ScatterDensityChart.png](text:image:1b62)
%[text]{"align":"center"} 
%[text] **Documentation**
%[text] - [`pdist2`](<matlab: doc( "pdist2" )>): Pairwise distance between two sets of observations \
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] 
%%
%[text] %[text:anchor:H_9D39F212] ## Create sample x and y data for the chart.
%[text] Let's create four clusters of normally-distributed data points.
%[text] Start by defining the covariance matrix used for all the clusters.
V = 0.2 * eye( 2 );
%[text] Next, generate random samples with different means.
numSamples = 2000;
rng( "default" )
C1 = mvnrnd( [1, 1], V, numSamples);
C2 = mvnrnd( [-1, 1], V, numSamples );
C3 = mvnrnd( [1, -1], V, numSamples );
C4 = mvnrnd( [-1, -1], V, numSamples );
%[text] Create the chart data vectors.
x = [C1(:, 1); C2(:, 1); C3(:, 1); C4(:, 1)];
y = [C1(:, 2); C2(:, 2); C3(:, 2); C4(:, 2)];
%%
%[text] %[text:anchor:H_4B8E3C82] ## Create a figure for the chart.
f = exampleFigure( "Name", "ScatterDensityChart Example" ); %[output:6f4ae5f9]
%%
%[text] %[text:anchor:H_3DFA2164] ## Create the chart.
SDC = ScatterDensityChart( "Parent", f, ...     %[output:group:81974ad5] %[output:6f4ae5f9]
    "XData", x, ... %[output:6f4ae5f9]
    "YData", y ); %[output:group:81974ad5] %[output:6f4ae5f9]
%%
%[text] %[text:anchor:H_CBFCA9A4] ## Annotate the chart.
xlabel( SDC, "x-data", "FontSize", 14 ) %[output:5c233238]
ylabel( SDC, "y-data", "FontSize", 14 ) %[output:5c233238]
title( SDC, "Scatter Density Chart", "FontSize", 16 ) %[output:5c233238]
grid( SDC, "minor" ) %[output:5c233238]
legend( SDC, "Sample data", "FontSize", 12 ) %[output:5c233238]
%%
%[text] %[text:anchor:H_278E7724] ## Increase the chart's marker size.
%[text] We can adjust the size of the markers in two ways. First, the `SizeData` property can be a scalar value, which applies the same size to all the data points.
SDC.SizeData = 100; %[output:7867567f]
%%
%[text] %[text:anchor:H_8A911E9E] ## Equip the data points with variable marker sizes.
%[text] %[text:anchor:H_E503D1C7] The `SizeData` property can be a vector of sizes, one element for each data point.
SDC.SizeData = randi( 500, size( SDC.XData ) ); %[output:425f0797]
%%
%[text] %[text:anchor:H_FCEC6213] ## Change the colormap used in the chart.
%[text] The chart is equipped with the `colormap` method for modifying the color scheme used for the data points, and the `colorbar` method to provide control over the chart's colorbar.
%[text] Change the colormap.
colormap( SDC, "turbo" ) %[output:9ad3733d]
%[text] Annotate the chart's colorbar.
cb = colorbar( SDC ); %[output:9ad3733d]
cb.Location = "southoutside"; %[output:9ad3733d]
ylabel( cb, "Scatter density" ) %[output:9ad3733d]
%[text] The `ScatterDensity` chart has the `CLim` property, which is a 2-element vector used to set a custom range for the color limits. The first element of CLim specifies the data value to map to the first color in the colormap, and the second specifies the data value to map to the last color.
SDC.CLim = [0, 1000]; %[output:9ad3733d]
%%
%[text] %[text:anchor:H_E358A41E] ## Change the density calculation method.
SDC.DensityMethod = "boundary"; %[output:8119d2cc]
legend( SDC, "off" ) %[output:8119d2cc]
colorbar( SDC, "off" ) %[output:8119d2cc]
%%
%[text] %[text:anchor:H_553549D7] ## Adjust the radius parameter used in the density calculation.
SDC.Radius = 0.7; %[output:58ddeec4]
%%
%[text] %[text:anchor:H_47ED7D48] ## Update the chart data and change the density calculation method.
set( SDC, "XData", C1(:, 1), "YData", C1(:, 2) ) %[output:6bae98f6]
SDC.DensityMethod = "noboundary"; %[output:6bae98f6]
SDC.SizeData = 400; %[output:6bae98f6]
grid( SDC, "off" ) %[output:6bae98f6]
%%
